import React from 'react';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import { CardActionArea } from '@mui/material';
import CardMedia from '@mui/material/CardMedia';
import LocationOnIcon from '@mui/icons-material/LocationOn';
import StarIcon from '@mui/icons-material/Star';
export default function House(props) {
  const itemtitle={
    fontSize:"18px",
    fontWeight : 'bold',
    margin: "20px",
    flexDirection: 'column',
    alignItems: 'center',
    height:"100px",
    width: '340px',
    overflow : 'hidden',
    textOverflow: 'ellipsis',
    display: '-webkit-box',
    webkitLineClamp: '8',
    webkitBoxOrient: 'vertical'
  }

  return (
    <div>
    <div className="flex items-center justify-center">
          <picture className="max-w-[100px] sm:max-w-[150px] aspect-square m-2">
            <img
              src={`${props.url}`}
              alt={props.name}
              loading="lazy"
              className="w-full h-full rounded-full shadow-lg object-cover"
            ></img>
          </picture>
        </div>
        <div className="mx-2">
          <div className="my-2 sm:text-center">
            <div className="text-xl md:text-2xl font-medium">{prop.name}</div>
            <div className="text-md md:text-lg font-normal">{prop.name}</div>
          </div>
        </div>
    </div>
  );
}
